/**
 * @param {number[]} nums
 * @param {number} modulo
 * @param {number} k
 * @return {number}
 */
var countInterestingSubarrays = function(nums, modulo, k) {
    let count = 0;
    for (let start = 0; start < nums.length; start++) {
        let cnt = 0;
        for (let end = start; end < nums.length; end++) {
            if (nums[end] % modulo === k) cnt++;
            if (cnt % modulo === k) count++;
        }
    }
    return count;
};
